description:
History of Art
Barnes &amp; Noble | 1967 | ISBN: 0380000140 | English | 356 pages | PDF | 32 MB

&quot;Written with intelligence and humor (the introduction, alone, is worth many times the price of the book) this art analysis . . . ranges from the Ancient World to 'Art in the Future' ... to offer in reasonable compass an enlightening discussion of the visual arts. Whether you are interested in old masters or new, here is a little volume that threads art periods and personalities on a cord of basic continuity.&quot;
